import CardBS from 'react-bootstrap/Card';

export const Card = () =>{
    return(
        <CardBS className="bg-dark text-white">
        <CardBS.Img src="https://guiadoestudante.abril.com.br/wp-content/uploads/sites/4/2016/12/carolina-bibliotecadesp.jpg?quality=100&strip=info" alt="Card image" />
        <CardBS.ImgOverlay>
          <CardBS.Title>Mulheres Brasileiras</CardBS.Title>
          <CardBS.Text>
            Este é um pequeno exemplo de mulheres Brasileiras que fizeram história em diversos setores da sociedade, escritoras, atrizes, cantoras 
          </CardBS.Text>
          <CardBS.Text>Last updated 3 mins ago</CardBS.Text>
        </CardBS.ImgOverlay>
      </CardBS>
  
    )
}
